import React from 'react';
import Avatar from './Avatar';

const AvatarList = props => {

	const avatarList = props.avatars.map(
		(name,image) => {
			return <Avatar name={name} image={image}></Avatar>
		}
	);
	return <div>{avatarList}</div>;
};

export default AvatarList;
